import React from 'react';
import { AuthProvider } from './components/auth/AuthProvider';
import { AppRoutes } from './components/routes/index';

const App = () => {
  return (
    <AuthProvider>
      <AppRoutes />
    </AuthProvider>
  );
};

export default AuthProvider;
